import avatar from "./../../images/avatarheader.png";

import { RiShoppingCart2Line } from "react-icons/ri";
import { Link } from "react-router-dom";

const Header = () => {
    return ( 
        <header className="header">
        <div className="header__content">

        <div className="leftheader">
          <a href="https://example.com" ><span className="brandName">X-course task / </span></a>
          <a href="https://www.facebook.com/irina.skaraeva" target="_blank" rel="noreferrer" className="author"><span> Iryna Skaraieva</span></a>
        </div>

        <nav className="nav">
          <div className="burger">
            <div className="burger__bar"></div>
            <div className="burger__bar"></div>
            <div className="burger__bar"></div>
          </div>

          <Link to='/cart'><RiShoppingCart2Line style={color=''}/></Link>
          <button type="submit" className="btn"><span>Sing-Out</span></button>
          <a href="https://example.com"><img src={avatar} width="40px" height="40px" alt="circle-icon" className="headerimg2" /></a>
          <a href="https://example.com" className="username"><span>Username</span></a>
        </nav>

      </div>
      </header>
     );
}

export default Header;
